        fetch('http://localhost:5000/projects').then(resp => resp.json()).then(data => this.setState({projects: data}))
    }

    componentDidMount () {
        this.fetchProjects()
    }


    render() { 
        return (  
            <div>
                <h1>See projects bellow</h1>

            </div>
        )
    }
}

